/*
https://leetcode.com/problems/find-all-anagrams-in-a-string/description/

Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.

Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.

The order of output does not matter.

Example 1:
    Input:
        s: "cbaebabacd" p: "abc"
    Output:
        [0, 6]
    Explanation:
        The substring with start index = 0 is "cba", which is an anagram of "abc".
        The substring with start index = 6 is "bac", which is an anagram of "abc".
Example 2:
    Input:
        s: "abab" p: "ab"
    Output:
        [0, 1, 2]
    Explanation:
        The substring with start index = 0 is "ab", which is an anagram of "ab".
        The substring with start index = 1 is "ba", which is an anagram of "ab".
        The substring with start index = 2 is "ab", which is an anagram of "ab".
*/

package main

import (
  "fmt"
  "strings"
)

// There is better & faster solution, just calculate subsHash Once, then manipulating the underlying array while looping

func findAnagrams(s string, p string) []int {
  pLen := len(p)
  sLen := len(s)
  if sLen < pLen {
    return []int{}
  }

  res := make([]int, 0)
  pHash := stringHash(p)

  for i := 0; i <= sLen-pLen; i++ {
    subs := s[i : i+pLen]
    subsHash := stringHash(subs)
    if sliceEquals(pHash, subsHash) {
      res = append(res, i)
      for i < sLen-pLen {
        if s[i] == s[i+pLen] {
          res = append(res, i+1)
          i++
        } else {
          idx := strings.IndexRune(subs, rune(s[i+pLen]))
          if idx > 0 {
            i += idx - 1
          } else if idx == -1 {
            i += pLen
          }
          break
        }
      }
    } else {
      for ; i < sLen-pLen && s[i] == s[i+pLen]; i++ {
      }
    }
  }
  return res
}

func stringHash(s string) []int {
  res := make([]int, 26)
  for _, c := range s {
    res[int(c-'a')]++
  }
  return res
}

func sliceEquals(a, b []int) bool {
  for i, n := range a {
    if n != b[i] {
      return false
    }
  }
  return true
}

func main() {

  fmt.Println(findAnagrams("abaacbabc", "abc"))

  fmt.Println(findAnagrams(
    "",
    "",
  ))
}
